var img = document.createElement("img");
var listArray = document.querySelectorAll('.autopagerize_page_separator~article figure');
for (var i = 0; i < listArray.length; i++) {
  listArray[i].appendChild(img.cloneNode(true));
}
var listArray2 = document.querySelectorAll('.autopagerize_page_separator~article figure>img');
var listArray3 = document.querySelectorAll('.autopagerize_page_separator~article figure');
for (var j = 0; j < listArray3.length; j++) {
  listArray2[j].src=listArray3[j].dataset.loadimageBackground;
}

