data.Stylish:
@-moz-document domain("librabuch.jp") {
  .row{display:flex;
   flex-wrap:wrap;}
  .row .col{width:47% !important;}
  .summary{height: 140px;
   overflow: hidden;}
  .card-title{display:flex;}
  .card-title a{ white-space:nowrap; overflow:hidden; text-overflow: ellipsis;}
}

data.bookmarklet:
var result = document.evaluate('//p[@class="summary"][not(./node())]', document, null, 7, null);
for(var i=0;i<result.snapshotLength;i++) 
	{ 
  		result.snapshotItem(i).style.display="none";
	}

var result = document.evaluate('//a[./img[@class="thumb-image"]]', document, null, 7, null);
    var result2 = document.evaluate('//img[@class="thumb-image"]', document, null, 7, null);
    for(var i=0;i<result.snapshotLength;i++)
   {
     result2.snapshotItem(i).src=result.snapshotItem(i).href+"?format=300w"
   }

